import { FC } from "react";
import { CustomLink } from "../../CustomLink/CustomLink";
import { FaActiveTable, FaNoActiveTable } from "../../icons/icons";
import { Link, useLocation } from "react-router-dom";

export const MainTableNavigation: FC = () => {
  const { pathname } = useLocation();
  const mainTablePath = pathname === "/main_table";
  const timelinePath = pathname === "/timeline";
  return (
    <div className="desktop:flex hidden items-center border w-[40%]">
      <div>
        <span className="text-lg pl-6 font-medium  pr-4">Project Name</span>
      </div>
      <div className="flex items-center">
        <Link to="/main_table">
          {mainTablePath ? <FaActiveTable /> : <FaNoActiveTable />}
          <span className="text-sm font-medium">Main Table</span>
        </Link>
      </div>
      <div>
        <CustomLink to="/timeline">
          <span className="px-4 text-sm font-medium border-l">Timeline </span>
        </CustomLink>
      </div>
    </div>
  );
};
